import React from 'react';
import './Testimonial.css';

function Testimonial({ title, quote, author, position }) {
  return (
    <div className="testimonial">
      <h2>{title}</h2>
      <blockquote>
        "{quote}"
      </blockquote>
      <cite>
        {author}<br />
        {position}
      </cite>
    </div>
  );
}

export default Testimonial;
